Album Info

While there are a whole lot of highlights on TVT's Crunk Hits, Vol. 3, putting the word &quot;Crunk&quot; on the cover is a misguided move since there isn't enough of that down and dirty Southern party music included to earn that bit of street slang. The first two volumes may have bent the rules without coming off as clueless, but Vol. 3 acts like Grandma when it declares the pop-tacular Pussycat Dolls or the entirely Harlem Webstar &quot;Crunk.&quot; Ignore it and you're left with a serviceable overview of some of what was poppin' on urban radio in 2005/2006 with representation for the crooners (Akon, Tyrese), the down South grinders (Paul Wall, Three 6 Mafia), and those Hyphy folks from the Bay Area (E-40, Too Short).

